import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import firstImage from './scratch-images-teacher/first-row-image';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  }
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={3}>
          <div className={classes.paper}>row1</div>
          <div className="imageFirstRow">

              
          </div>
        </Grid>
        <Grid item xs={3}>
          <div className={classes.paper}>row2</div>
        </Grid>
        <Grid item xs={3}>
          <div className={classes.paper}>row3</div>
        </Grid>
        <Grid item xs={3}>
          <div className={classes.paper}>row4</div>
        </Grid>
      </Grid>
    </div>
  );
}
